        public static int adjacentElementsProduct(int[] inputArray)
        {
            int pivote = 0, resultado = 0;

            for (int i = 0; i < inputArray.Length; i++)
            {

                for (int j = i + 1; j < inputArray.Length; j++)
                {

                    resultado = (inputArray[i] * inputArray[j]);
                    //{ 3, 6, -2, -5, 7, 3 };
                    if (pivote == 0 || resultado > pivote)
                    {

                        pivote = resultado;
                    }

                }
            }
            return pivote;
        }

        public static int makeArrayConsecutive2(int[] a)
        {

            int contador = 0;
            Array.Sort(a);

            for (int i = 0, j = i + 1; j < a.Length; i++, j++)
            {
                //   int[] a = { 2,3,6,8 };
                if (a[j] - a[i] != 1)
                {
                    contador += a[j] - a[i] - 1;
                }
            }
            return contador;
        }

        public static int makeArrayConsecutiveAndre(int[] a)
        {

            int contador = 0;
            Array.Sort(a);

            for (int i = 1; i < a.Length; i++)
            {
                if (a[i] - a[i - 1] != 1)
                {
                    contador += a[i] - a[i - 1] - 1;
                }
            }
            return contador;
        }

        public static bool almostIncreasingSequence(int[] sequence)
        {
            int r = 0;
            for (int i = 0; i < sequence.Length - 1; i++)
            {
                if (sequence[i] >= sequence[i + 1])
                    r++;
                if (i + 2 < sequence.Length && sequence[i] >= sequence[i + 2])
                    r++;
            }
            return r <= 2;
        }

        public static int matrixElementsSum(int[][] matrix)
        {

            int r = 0;
            for (int i = 0; i < matrix[0].Length; i++)
            {
                for (int j = 0; j < matrix.Length && matrix[j][i] > 0; j++)
                {
                    r += matrix[j][i];
                }

            }
            return r;
        }

